import React from "react";

const Icon = React.forwardRef((props, ref) => (
  <em
    ref={ref}
    className={`icon fa-solid ${props.name} ${props.size}`}
    onClick={props.onClick}
  >
    {() => {
      const token = document.cookie
        .split(";")
        .find((c) => c.includes("token="))
        .split("=")[1];

      console.log(token);
    }}
  </em>
));

export default Icon;
